INSERT INTO `wp_options` VALUES (77,'widget_text','a:7:{i:1;a:0:{}i:2;a:4:{s:5:\"title\";s:33:\"Encuentre el hogar de sus sueños\";s:4:\"text\";s:124:\"Nuestra misión es colaborar con nuestros clientes para que tomen la mejor decisión de compra de acuerdo a sus necesidades.\";s:6:\"filter\";b:1;s:6:\"visual\";b:1;}i:3;a:4:{s:5:\"title\";s:0:\"\";s:4:\"text\";s:173:\"<h1 class=\"tagline\">Consulte con un profesional <a class=\"button alignright\" href=\"/contacto\">Contáctenos <span class=\"dashicons dashicons-admin-network\"></span></a></h1>\r\n\";s:6:\"filter\";b:1;s:6:\"visual\";b:1;}i:4;a:4:{s:5:\"title\";s:26:\"Tu Solución Bienes Raices\";s:4:\"text\";s:202:\"<img class=\"alignnone size-medium wp-image-901\" src=\"http://tu-solucion.local/wp-content/uploads/2021/01/cropped-tu-solucion-logo-grande.png\" alt=\"\" width=\"200\" height=\"200\" style=\"border-radius:50%\" />\";s:6:\"filter\";b:1;s:6:\"visual\";b:1;}i:5;a:4:{s:5:\"title\";s:8:\"Nosotros\";s:4:\"text\";s:478:\"<!-- wp:paragraph -->\r\n\r\nTu Solución Bienes Raíces es una empresa con más de 25 años de experiencia. Nos especializamos en promover propiedades y proyectos inmobiliarios en la ciudad de Guatemala y zonas aledañas.\r\n\r\n<!-- /wp:paragraph --> <!-- wp:paragraph -->\r\n\r\nNuestra misión es encontrar la vivienda ideal para cada cliente acorde a sus necesidades y presupuesto. Permítenos ser Tu Solución en la búsqueda de tu nueva propiedad. Será un gusto atenderle!\r\n\r\n&nbsp;\";s:6:\"filter\";b:1;s:6:\"visual\";b:1;}i:6;a:4:{s:5:\"title\";s:0:\"\";s:4:\"text\";s:68:\"Página creada por <a href=\"http://tefisaravia.com\">Tefi Saravia</a>\";s:6:\"filter\";b:1;s:6:\"visual\";b:1;}s:12:\"_multiwidget\";i:1;}','yes');
