INSERT INTO `wp_posts` VALUES (73,1,'2010-08-15 19:11:13','2010-08-15 19:11:13','<!-- wp:paragraph -->\n<p>Tu Solución Bienes Raíces es una empresa especializada en promover propiedades y proyectos inmobiliarios en la ciudad de Guatemala y zonas aledañas. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Es una empresa con más de 25 años de experiencia, cuya misión es encontrar la vivienda ideal para cada cliente acorde a sus necesidades y presupuesto. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Será un gusto atenderle. </p>\n<!-- /wp:paragraph -->','Nosotros','','draft','closed','closed','','nosotros','','','2021-01-19 02:08:43','2021-01-19 02:08:43','',0,'http://demo.studiopress.com/genesis',0,'page','',0);
