INSERT INTO `wp_posts` VALUES (779,1,'2021-01-15 03:27:59','2021-01-15 03:27:59','&nbsp;\n<h3><strong>Información de la propiedad</strong></h3>\nExclusivo sector en zona 14, únicamente 8 casas en el condominio.\n300 M2 de construcción en tres niveles.\n(Área social y dormitorios en 1er y 2do nivel, lavandería y dormitorio de servicio, patio de lavandería en sótano)\n<ul>\n 	<li style=\"list-style-type: none;\">\n<ul>\n 	<li>Tres amplios dormitorios, principal con baño y wc, secundarios comparten baño.</li>\n 	<li>Sala y comedor con vista a jardín.</li>\n 	<li>Baño de visitas.</li>\n 	<li>Cocina cerrada, despensa.</li>\n 	<li>Dormitorio de servicio.</li>\n 	<li>Jardín con pérgola.</li>\n</ul>\n</li>\n</ul>\n<ul>\n 	<li>Estacionamiento para dos vehículos.</li>\n 	<li>Jardín de aproximadamente 30 M2</li>\n 	<li>Dos bodegas.</li>\n 	<li>No tiene parqueo para visitas. Se puede adaptar un tercer estacionamiento para carro pequeño.</li>\n 	<li>No hay amenidades.</li>\n 	<li>La casa se encuentra en perfectas condiciones.</li>\n 	<li>Inversión $450,000.00 + impuestos</li>\n</ul>\n<h3><strong>Imágenes de la propiedad</strong></h3>\n[rl_gallery id=\"822\"]','Casa en Venta - Zona 14','','inherit','closed','closed','','500-autosave-v1','','','2021-01-15 03:27:59','2021-01-15 03:27:59','',500,'http://tu-solucion.local/500-autosave-v1/',0,'revision','',0);
