INSERT INTO `wp_posts` VALUES (998,1,'2021-01-19 23:48:54','2021-01-19 23:48:54','&nbsp;\r\n<h3><strong>Información de la propiedad</strong></h3>\r\n<ul>\r\n 	<li>Apartamento en venta zona 14</li>\r\n 	<li>Nivel alto</li>\r\n 	<li>260 metros de apartamento</li>\r\n 	<li>Sala-comedor</li>\r\n 	<li>Balcón amplio</li>\r\n 	<li>Baño de visitas</li>\r\n 	<li>Cocina con gabinetes y línea blanca</li>\r\n 	<li>Sala familiar</li>\r\n 	<li>​3​ dormitorios cada uno con baño</li>\r\n 	<li>Dormitorio de servicio con baño</li>\r\n 	<li>Lavandería</li>\r\n 	<li>​3 parqueos</li>\r\n 	<li>1 bodega</li>\r\n 	<li>Finos acabados\r\n​\r\nPrecio US$​501,000.00\r\nEl edificio cuenta con lobby, 2 salones sociales, piscina, business center, área verde con juegos para niños, gimnasio y parqueo de visitas.</li>\r\n</ul>\r\n<strong>Imágenes de la propiedad</strong>\r\n\r\n[rl_gallery id=\"976\"]','Apartamento en Venta - Zona 14','','publish','closed','closed','','apartamento-en-venta-zona-14-duplicate-1-2','','','2021-01-19 23:48:54','2021-01-19 23:48:54','',0,'http://tu-solucion.local/?post_type=listing&#038;p=998',0,'listing','',0);
